create table accounts
(
    Id                 int           not null
        primary key,
    Nickname           mediumtext    not null,
    LastConnection     datetime      null,
    LastIp             mediumtext    null,
    ConnectedCharacter int           null,
    BankKamas          int           not null,
    Tokens             int           not null,
    NewTokens          int default 0 not null,
    LastLoterieDate    datetime      null,
    Vip                int default 0 null
)
    engine = MyISAM
    charset = utf8;

create index Id
    on accounts (Id);

